package main
import (
  "bytes"
  "encoding/base64"
  "github.com/computeportal/glui"
)
const (
  jaguar_data =""
)
var jaguar = &glui.ImageData{nil, 0, 0}
func load_jaguar() bool {
  b, err := base64.StdEncoding.DecodeString(jaguar_data)
  if err != nil {panic(err)}
  buf := bytes.NewBuffer(b)
  data, err := glui.DecodeJPG(buf)
  if err != nil {panic(err)}
  jaguar.Pix = data.Pix
  jaguar.W = data.W
  jaguar.H = data.H
  return true
}
var jaguar_loaded = load_jaguar()